  false,\n\t\"url\": null,\n\t\"notes\": \"Devils Lake Wetland Management District
  lacks quantitative data available for populations of non-game bird species. In efforts
  to begin closing this data gap, and appropriately plan for the drafting and implementing
  of the District's Comprehensive Conservation Plan, a survey of upland songbirds
  was conducted in 2003 and 2004. The objective of the 2004 portion of this survey
  was to obtain an inventory of the upland songbirds within the DLWMD. The results
  will provide data on presence for the species detected, and also the estimated species
  richness on the WPAs surveyed. This report is on the upland bird survey performed
  in 2004 and the methods, results and discussion of findings.\",\n\t\"license_title\":
